import React from "react";
import "./cta.css";

const CTA = () => {
  return (
    <div className="CTA">
      <div className="CTA-content">
        <p>Request Early Access to Get Started</p>
        <h2>Register today & start exploring the endless possiblities.</h2>
      </div>
      <button type="button">Get Started</button>
    </div>
  );
};

export default CTA;
